(387, 1, '2019-12-27 10:39:37', '2019-12-27 10:39:37', '<!-- wp:paragraph -->\n<p>Sendmail has always been a headache for programmers while installing in Ubunutu. You can follow the below steps to make it faster within a minute</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Installed <code>sendmail</code> through <code>terminal</code></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class="wp-block-code"><code>apt-get install sendmail\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>then opened the&nbsp;<code>hosts</code>&nbsp;file</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class="wp-block-code"><code># edited from: sudo gedit etc/hosts\nsudo gedit /etc/hosts\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>replaced the the line</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class="wp-block-code"><code>127.0.0.1 localhost\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>with</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class="wp-block-code"><code>127.0.0.1 localhost localhost.localdomain mydomainname\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>To get the&nbsp;<code>domain name</code>&nbsp;please type</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class="wp-block-code"><code>hostname\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>in&nbsp;<code>terminal</code>&nbsp;and run.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>restart apache</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class="wp-block-code"><code>sudo service apache2 restart</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Sendmail in Ubuntu', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2019-12-27 10:39:37', '2019-12-27 10:39:37', '', 1, 'http://localhost/javelin/2019/12/27/1-revision-v1/', 0, 'revision', '', 0),
